L'application de la Ville de Differdange vous permet d'accéder :

- aux départs des bus en temps réel ;
- aux actualités et l'agenda de la commune ; 
- aux informations sur la vie politique de la commune ;
- au taux d’occupation des parkings publics en temps réel ;
- à la disponibilité des vélos en libre-service Vël'OK en temps réel ;
- à l’info-trafic des autoroutes principales ;
- à l’agenda le plus complet pour des événements sur le territoire de la commune.

Il vous sera également possible de : 
- contacter directement la commune ;
- rechercher des points d‘intérêts à proximité tels que des infrastructures sportives, culturelles ou autres ; 
- signaler à l'administration un dysfonctionnement dans l’espace public ;
- recevoir des notifications en cas d'urgence.
